NO CONTEST plea entered to count 1, possess THC - 2nd offense.  Convicted.
The State moves to dismiss and read in count 2, paraphernalia.  Motion granted.
Sentence Withheld.  Defendant is placed on probation to DOC for eighteen (18) months.
Conditions of probation:
1) Spend thirty (30) days in the county jail, under the Huber Law, stayed and to be imposed at the agents discretion and upon order of the court;
2) AODA assessment and follow through;
3) Submit to random urine screens and pay for same;
4) Assessment, treatment, counseling as deemed appropriate by the Departments assessment process;
5) Maintain fulltime employment/schooling or combination; once released from inpatient treatment;
6) Maintain absolute sobriety;
7) Pay court costs;
8) pay supervision fees in an amount to be determined by DOC;
9) provide DNA sample and pay the surcharge;
10) no contact with any known drug dealers or users;
11) defendant must successfully complete inpatient treatment at Pathways to a Better Life.  If not, the jail condition is to be imposed.
Probation review hearing is set for 10-15-15 at 8:30 a.m.
Minutes.
